INSERT [dbo].[Article] ([ID], [SortID], [KID], [Title], [Summary], [KeyWords], [Content], [Quote], [Thumbs], [Files], [CreateDate], [CreateUserID], [LastUpdateDate], [LastUpdateUserID], [IsDeleted]) VALUES (1, 0, 4, N'模压', N'奇才', N'模压', N'<pre class="prettyprint lang-cs">using System;using System.Collections.Generic;using System.Linq;using System.Web;using System.Web.Mvc;using System.Text;using Models;using Common;using Webdiyer.WebControls.Mvc;using System.Data.Objects;using System.Drawing;using System.Threading;using System.IO;using System.Data;namespace Web.Controllers{    [UserActionFilter]    public class ChartController : Controller    {        DBKolService DBKService = new DBKolService();        DB_KolEntities db = new DBKolService().DBKService;        public ActionResult Index()        {            return View();        }        //专家        public ActionResult Expert(int? pageIndex, string beginTime, string endTime, string expertType)        {            string sqlStr = "select * from c_experts where 1=1 ";            string conStr = "";            if (!string.IsNullOrEmpty(beginTime))            {                conStr += " and created&gt;=''" + beginTime + "''";            }            if (!string.IsNullOrEmpty(endTime))            {                conStr += " and created&lt;=''" + endTime + "''";            }            if (!string.IsNullOrEmpty(expertType))            {                conStr += " and  ExpertsPositioning =''" + expertType + "''";            }            sqlStr += conStr;            var experts = DBKService.DBKService.ExecuteStoreQuery&lt;c_Experts&gt;(sqlStr, "c_Experts", MergeOption.AppendOnly);            PagedList&lt;c_Experts&gt; expertPages = new PagedList&lt;c_Experts&gt;(experts.OrderByDescending(bo =&gt; bo.Created).ToList(), pageIndex ?? 1, 12);            return View(expertPages);        }        #region 专家状态分布        Random random = new Random(DateTime.Now.Millisecond);        double GetRD()        {            double str = 0;            double sin = random.NextDouble() - 0.5;            str = sin;            return str;        }        string GetOrganizationName(double OrganizationNameNum)        {            string str = "认可新型口服抗凝药";            int OrganizationNameNumInt = 0;            try            {                OrganizationNameNumInt = (int)Math.Round(Math.Abs(OrganizationNameNum));            }            catch            {                OrganizationNameNumInt = 1;            }            if (OrganizationNameNumInt == 1)            {                str = "认可新型口服抗凝药";            }            if (OrganizationNameNumInt == 2)            {                str = "知晓达比加群";            }            if (OrganizationNameNumInt == 3)            {                str = "认可达比加群";            }            if (OrganizationNameNumInt == 4)            {                str = "达比加群讲者";            }            if (OrganizationNameNumInt == 5)            {                str = "达比加群推崇者";            }            return str;        }        int GetOrganizationNameNum(string OrganizationName)        {            int str = 1;            if (OrganizationName.IndexOf("认可新型口服抗凝药") &gt; -1)            {                str = 1;            }            if (OrganizationName.IndexOf("知晓达比加群") &gt; -1)            {                str = 2;            }            if (OrganizationName.IndexOf("认可达比加群") &gt; -1)            {                str = 3;            }            if (OrganizationName.IndexOf("达比加群讲者") &gt; -1)            {                str = 4;            }            if (OrganizationName.IndexOf("达比加群推崇者") &gt; -1)            {                str = 5;            }            return str;        }        int GetAdvisoryGroup(double IsAdvisoryGroup)        {            int str = 1;            try            {                str = (int)(Math.Round(Math.Abs(IsAdvisoryGroup)));            }            catch            {                str = 1;            }            return str;        }        string GetSeriesData(int IsAdvisoryGroup, string OrganizationName)        {            string str = "";            double r = 0.5;            double ag = GetRD();            double on = GetRD();            double th = Math.Sqrt(Math.Pow(r, 2) - Math.Pow(ag, 2));            if (Math.Abs(on) &gt; Math.Abs(th))            {                on = th;            }            if (GetRD() &lt; 0)            {                on = 0 - on;            }            ag = ag + IsAdvisoryGroup;            on = on + GetOrganizationNameNum(OrganizationName);            str = "[" + Math.Round(ag, 3) + "," + Math.Round(on, 3) + "]";            return str;        }        public ActionResult ExpertsStateDistribution(string ExpertsPositioning)        {            ViewData["seriesData"] = "";            ViewData["expertData"] = null;            string sql = "select * from c_experts where eid&gt;0";            if (!string.IsNullOrEmpty(ExpertsPositioning))            {                sql += " and ExpertsPositioning=''" + ExpertsPositioning + "''";            }            var elts = DBKService.DBKService.ExecuteStoreQuery&lt;c_Experts&gt;(sql, "c_Experts", MergeOption.AppendOnly).ToList();            if (elts != null)            {                //chart数据                string str = "[";                foreach (var item in elts)                {                    str += GetSeriesData(item.IsAdvisoryGroup ?? 1, item.OrganizationName) + ",";                }                str += "]";                ViewData["seriesData"] = str;                //列表数据                string[,] expertData = new string[6, 11];                for (int i = 1; i &lt;= expertData.GetUpperBound(0); i++)                {                    for (int j = 0; j &lt;= expertData.GetUpperBound(1); j++)                    {                        sql = "select count('''') from c_experts where IsAdvisoryGroup=" + (j + 1) + " and OrganizationName=''" + GetOrganizationName(i) + "''";                        if (!string.IsNullOrEmpty(ExpertsPositioning))                        {                            sql += " and ExpertsPositioning=''" + ExpertsPositioning + "''";                        }                        expertData[i, j] = SQLHelper.GetSingle(sql).ToString();                    }                }                ViewData["expertData"] = expertData;            }            return View();        }        [HttpPost]        public ActionResult GetSeriesTitle(double IsAdvisoryGroup, double OrganizationNameNum, string ExpertsPositioning)        {            string str = "";            string sql = "select * from c_experts where IsAdvisoryGroup=" + GetAdvisoryGroup(IsAdvisoryGroup) + " and OrganizationName=''" + GetOrganizationName(OrganizationNameNum) + "''";            if (!string.IsNullOrEmpty(ExpertsPositioning))            {                sql += " and ExpertsPositioning=''" + ExpertsPositioning + "''";            }            var elts = DBKService.DBKService.ExecuteStoreQuery&lt;c_Experts&gt;(sql, "c_Experts", MergeOption.AppendOnly).ToList();            int ag = 1;            string on = "";            if (elts != null)            {                int i = 0;                foreach (var item in elts)                {                    i++;                    if (i &gt; 11)                    {                        str += "...&lt;br/&gt;";                        break;                    }                    ag = item.IsAdvisoryGroup ?? 1;                    on = item.OrganizationName;                    str += string.Format("{0,10}", item.RealName) + ",重要性:" + item.IsAdvisoryGroup + "分,Level:" + GetOrganizationNameNum(item.OrganizationName) + "级&lt;br/&gt;";                }                str += "&lt;a href=''/ExpertManagement/Index?IsAdvisoryGroup=" + ag + "&amp;OrganizationName=" + on + "''&gt;共计：" + elts.Count + "人&lt;/a&gt;";            }            return Content(str);        }        #endregion        public ActionResult VisitExpertsStatus()        {            return View();        }        //活动        public ActionResult Active(int? pageIndex, string beginTime, string endTime, string expertType)        {            string sqlStr = "select * from c_experts where eid in (select eid from c_ExpertActivitys) ";            string conStr = "";            if (!string.IsNullOrEmpty(beginTime))            {                conStr += " and created&gt;=''" + beginTime + "''";            }            if (!string.IsNullOrEmpty(endTime))            {                conStr += " and created&lt;=''" + endTime + "''";            }            if (!string.IsNullOrEmpty(expertType))            {                conStr += " and  ExpertsPositioning =''" + expertType + "''";            }            sqlStr += conStr;            var experts = DBKService.DBKService.ExecuteStoreQuery&lt;c_Experts&gt;(sqlStr, "c_Experts", MergeOption.AppendOnly);            PagedList&lt;c_Experts&gt; expertPages = new PagedList&lt;c_Experts&gt;(experts.OrderByDescending(bo =&gt; bo.Created).ToList(), pageIndex ?? 1, 12);            return View(expertPages);        }        public ActionResult ActiveList(int eid)        {            var expertActives = DBKService.DBKService.c_ExpertActivitys.Where(bo =&gt; bo.EID == eid).ToList();            return View(expertActives);        }        public ActionResult Export(int exportType, string beginTime, string endTime, string expertType)        {            string sqlStr = "";            string conStr = "";            if (exportType == 1)            {                sqlStr = "select region as 大区,(select name from b_areas where arid=a.city) as 城市,"                    + "realname as 姓名,hospital as 医院,department as 科室,job as 职称,IsAdvisoryGroup as 专家综合评估系数, "                    + " (select top 1 OrganizationName from c_ExpertsRecords where eid=a.eid) as 改变前认知状态, "                    + " OrganizationName  as 目前认知状态"                    + " from c_experts as a where 1=1 ";            }            else if (exportType == 2)            {                string url 