.Where(bo =&gt; bo.c_Experts.OrganizationName == OrganizationName);                    }                    //数据权限                    #region 数据权限                    try                    {                        int uid = Common.UserSession.Uid;                        int gid = Common.UserSession.Gid;                        if (gid &gt; 1)                        {                            DataPermissionService dc = new DataPermissionService();                            if (!dc.IsPermission(gid, uid, "专家权限", "全部", null, 1, null))                            {                                if (!dc.IsPermission(gid, uid, "专家权限", "全国", null, 1, null))                                {                                    theExpertActives = theExpertActives.Where(b =&gt; b.c_Experts.ExpertsPositioning.IndexOf("全国") == -1 || b.CreatedBy == uid);                                }                                if (!dc.IsPermission(gid, uid, "专家权限", "区域", null, 1, null))                                {                                    theExpertActives = theExpertActives.Where(b =&gt; b.c_Experts.ExpertsPositioning.IndexOf("区域") == -1 || b.CreatedBy == uid);                                }                                if (!dc.IsPermission(gid, uid, "专家权限", "省市", null, 1, null))                                {                                    theExpertActives = theExpertActives.Where(b =&gt; b.c_Experts.ExpertsPositioning.IndexOf("省市") == -1 || b.CreatedBy == uid);                                }                            }                        }                    }                    catch { }                    #endregion                    double nums = theExpertActives.Count();                    if (j == expertLevs.Count())                    {                        sbdata.Append(nums.ToString());                    }                    else                    {                        sbdata.Append(nums.ToString() + ",");                    }             