es = theExpertActives.Where(bo =&gt; bo.c_Experts.IsAdvisoryGroup &gt;= beginLevel &amp;&amp; bo.c_Experts.IsAdvisoryGroup &lt;= endLevel);                    }                    if (!string.IsNullOrEmpty(AnticoagulantConcept))                    {                        theExpertActives = theExpertActives.Where(bo =&gt; bo.c_Experts.AnticoagulantConcept == AnticoagulantConcept);                    }                    if (!string.IsNullOrEmpty(OrganizationName))                    {                        theExpertActives = theExpertActives.Where(bo =&gt; bo.c_Experts.OrganizationName == OrganizationName);                    }                    //数据权限                    #region 数据权限                    try                    {                        int uid = Common.UserSession.Uid;                        int gid = Common.UserSession.Gid;                        if (gid &gt; 1)                        {                            DataPermissionService dc = new DataPermissionService();                            if (!dc.IsPermission(gid, uid, "专家权限", "全部", null, 1, null))                            {                                if (!dc.IsPermission(gid, uid, "专家权限", "全国", null, 1, null))                                {                                    theExpertActives = theExpertActives.Where(b =&gt; b.c_Experts.ExpertsPositioning.IndexOf("全国") == -1 || b.CreatedBy == uid);                                }                                if (!dc.IsPermission(gid, uid, "专家权限", "区域", null, 1, null))                                {                                    theExpertActives = theExpertActives.Where(b =&gt; b.c_Experts.ExpertsPositioning.IndexOf("区域") == -1 || b.CreatedBy == uid);                                }                                if (!dc.IsPermission(gid, uid, "专家权限", "省市", null, 1, null))                                {                                    theExpertActives = theExpertActives.Where(b =&gt; b.c_Experts.ExpertsPositioning.IndexO