INSERT [dbo].[Article] ([ID], [SortID], [KID], [Title], [Summary], [KeyWords], [Content], [Quote], [Thumbs], [Files], [CreateDate], [CreateUserID], [LastUpdateDate], [LastUpdateUserID], [IsDeleted]) VALUES (26, 9, 4, N'我国第一支核潜艇部队首次解密 组建42年未发核事故', N'央广网北京10月28日消息（记者纪梦楠 李唐）据中国之声《新闻纵横》报道，昨天的一则消息，让无数的中国军事迷为之欢欣鼓舞，因为，我国第一支核潜艇部队在昨天首度对外解密，展示了它的真容。', N'央广网北京10月28日消息（记者纪梦楠 李唐）据中国之声《新闻纵横》报道，昨天的一则消息，让无数的中国军事迷为之欢欣鼓舞，因为，我国第一支核潜艇部队在昨天首度对外解密，展示了它的真容。', N'<p align="center">	<img src="http://china.cnr.cn/yaowen/201310/W020131028268830825668.jpg" width="550" height="367" /></p><p align="center">	我国第一支核潜艇部队首次解密</p><p>	央广网北京10月28日消息（记者纪梦楠 李唐）据中国之声《新闻纵横》报道，昨天的一则消息，让无数的中国军事迷为之欢欣鼓舞，因为，我国第一支核潜艇部队在昨天首度对外解密，展示了它的真容。</p><p>	资料显示，目前全世界公开宣称拥有核潜艇的国家有只有6个，美国、俄罗斯、中国、英国、法国、印度。从历史上第一艘核潜艇美国的“鹦鹉螺”号开始，因为其强大的威慑能力和生存能力，核潜艇迅速成为了一支象征大国地位，支撑国家安全的战略部队。</p><p>	说核潜艇重要，它有多重要呢？一位军事学家这样断言，“只需要一艘战略核潜艇，就可以让一个现代化国家退回石器时代。”或许这样的说法有些过于绝对，但毫无疑问，这从侧面说明核潜艇是一个国家大国地位的象征，是国家安全的重要支撑。</p><p>	的确，因此建设一支强大的核潜艇部队，这是国家的使命。我国在1970年12月，自行研制的第一艘核潜艇下水；1974年8月，第一艘核潜艇正式服役。</p><p>	那么，从组建至今，42年来我国核潜艇部队从无到有、从弱到强，默默的守护者祖国的海域，从来没有公开对外示人。这支部队强大而神秘，就连我们自己都很少听到他们的消息。这支驰骋在大洋深处的国之利器究竟是什么样的？官兵们在深海中是如何生活训练的？让我们跟随记者的脚步一探究竟。</p><p>	初冬时节，一艘核潜艇悄悄驶离码头扎入深海，开始了我国核潜艇首次最大自持力考核试验，经过漫长的90昼夜，创造世界核潜艇一次长航时间新纪录。基地副政委张武兵向记者讲述了当时的场景：</p><p>	张武兵：到第70天的时候，已经超过了法国核潜艇67天的长航纪录，当时做了一次民意调查，结果90%以上的艇员都选择继续航行。最后返回码头时，我们的战士们都是站在寒风里接受祖国和人民的检阅。 &nbsp;</p><!--/content-->', N'http://china.cnr.cn/yaowen/201310/t20131028_513951263.shtml', N'', N'', CAST(0x0000A265012B10AC AS DateTime), 3, NULL, NULL, 0)
